INSERT INTO `entlist` (`id_ent`, `name_ent`, `location`, `on_social_pro`, `career`, `businessName`, `Position`, `pic`, `image_name`) VALUES
(67, 'Gabe Newell', 'American', 'https://twitter.com/gabelnewell', '<ul><li><span style=\"font-family: Verdana, Geneva, sans-serif;\">Gabe Newell has led Valve Corp., which develops video games, since he confounded it in 1998 with former Microsoft colleague Mike Harrington.</span></li><li><span style=\"font-family: Verdana,Geneva,sans-serif;\">The company found initial success with games like <span style=\"color: rgb(97, 189, 109);\"><strong>Half-Life</strong></span> and <span style=\"color: rgb(97, 189, 109);\"><strong>Portal</strong></span>.</span></li><li><span style=\"font-family: Verdana,Geneva,sans-serif;\">Valve Corp. plays a big role in PC game sales through its Steam digital store; some liken it to the iTunes of video games.</span></li><li><span style=\"font-family: Verdana,Geneva,sans-serif;\">Steam sells game licenses to 125 million users of its own and other developers&#39; titles and collects a percentage of the sales.</span></li><li><span style=\"font-family: Verdana, Geneva, sans-serif;\">Forbes estimates that Newell owns just over half the company, which operates out of Bellevue, Washington.</span></li></ul>', 'Valve Corp.', 'Founder Valve Corp', 0x75706c6f6164732f676162656e2e6a7067, 'gaben.jpg'),
(68, 'Bill Gates', 'American', 'https://twitter.com/BillGates', '<h2><strong>1975</strong></h2><div data-200-top=\"transform:translate(0px,0);opacity:1\" data-bottom-top=\"transform:translate(100px,0);opacity:0\"><ul><li><span style=\"font-family: Georgia,serif;\">When Bill and Paul Allen started Microsoft, their vision of &ldquo;a computer on every desktop and in every home&rdquo; seemed far fetched to most people.&nbsp;</span></li><li><span style=\"font-family: Georgia,serif;\">Today, thanks to Microsoft and many other companies, that vision is a reality in many parts of the world, and personal technology is an integral&nbsp;part of society.</span></li><li><span style=\"font-family: Georgia,serif;\">Bill is passionate about Microsoft&rsquo;s work and will always be involved with the company, including his present role as a member of the board and technology advisor.&nbsp;</span></li></ul></div><h2><strong>1975</strong></h2><ul><li><h4><span style=\"font-size: 14px; font-family: Georgia, serif;\">Started Micro-Soft with Paul Allen in Albuquerque, NM.</span></h4></li></ul><h2><strong>1976</strong></h2><ul><li><h4><span style=\"font-size: 14px; font-family: Georgia, serif;\">Changed company name to Microsoft.</span></h4></li></ul>', 'Microsoft', 'Founder Microsoft', 0x75706c6f6164732f62696c6c47617465732e6a7067, 'billGates.jpg'),
(69, 'Jack Ma', 'China', 'www.facebook.com/AliBabaJack/', '<ul><li><span style=\"font-family: Georgia, serif; font-size: 18px;\">A former English teacher, Jack Ma confounded and chairs Alibaba Group, one of the world&#39;s largest e-commerce businesses.</span></li><li><span style=\"font-size: 18px;\"><span style=\"font-family: Georgia,serif;\">The Hangzhou, China-based firm inked its first Olympic sponsorship deal and scored a streaming agreement with Disney in 2017.</span></span></li><li><span style=\"font-size: 18px;\"><span style=\"font-family: Georgia,serif;\">Alibaba&#39;s revenue in the 12 months ending in March 2017 rose by <span style=\"color: rgb(65, 168, 95);\">56% to $23 billion</span>.</span></span></li><li><span style=\"font-size: 18px;\"><span style=\"font-family: Georgia,serif;\">Its 2014 IPO in New York set a record as the world&#39;s biggest public stock offering, raising $25 billion.</span></span></li><li><span style=\"font-family: Georgia, serif; font-size: 18px;\">Ma&#39;s investments beyond Alibaba include stakes in Chinese entertainment industry firms Huayi Brothers and Beijing Enlight Media.</span></li></ul>', 'Alibaba Group', 'Founder Alibaba Group', 0x75706c6f6164732f6a61636b5f6d612e6a7067, 'jack_ma.jpg'),
(72, 'TEST', 'TEST', 'TEST', '<p><strong>TEST2<s>&nbsp;</s><span style=\"color: rgb(226, 80, 65); font-size: 36px;\"><s>TEST</s></span></strong></p>', 'TEST', 'TEST', 0x75706c6f6164732f676162656e2e6a7067, 'billGates.jpg'),
(73, 'test2', 'test2', 'test2', '<p><strong>test2</strong></p>', 'test2', 'test2', 0x75706c6f6164732f676162656e2e6a7067, 'gaben.jpg'),
(74, 'test3', 'test3', 'test3', '<p>test3</p>', 'test3', 'test3', 0x75706c6f6164732f676162656e2e6a7067, 'gaben.jpg'),
